import React from "react";

const PlanSummary = () => {
  // Dummy data
  const planName = "Retirement Plan";
  const totalValue = 125000;

  return (
    <section className="bg-purple-100 rounded-2xl p-8 mb-8 shadow-md text-center">
      <h2 className="text-purple-600 text-3xl font-bold mb-2">{planName}</h2>
      <div className="text-xl text-purple-900 font-semibold">
        Total Value:{" "}
        <span className="text-purple-700">${totalValue.toLocaleString()}</span>
      </div>
    </section>
  );
};

export default PlanSummary;
